"use strict";

function findMaxConsecutiveOnes(nums) {
    let res = 0, t = 0;
    for (let num of nums) {
        if (num === 1) {
            t += 1;
        } else {
            res = Math.max(res, t);
            t = 0;
        }
    }
    return Math.max(res, t);
}
